import Link from "next/link";
import { Navbar, Row, Col, Nav } from "react-bootstrap";
import styles from "./AppNavBar.module.css";

const AppNavbar = () => {
  return (
    <Navbar
      bg="transparent"
      variant="dark"
      className="d-flex justify-content-center"
      style={{ zIndex: 10 }}
    >
      <Nav>
        <Nav.Item>
          <Link href="/">Breaking Bad</Link>
        </Nav.Item>
      </Nav>
      <Navbar.Brand href="/" className="mr-0">
        <img
          alt=""
          src="/logo.png"
          width="250"
          height="150"
          className="d-inline-block align-top"
        />
      </Navbar.Brand>
      <Nav>
        <Nav.Item>
          <Link href="/spinoff" className={styles.links}>
            Better Call Saul
          </Link>
        </Nav.Item>
      </Nav>
    </Navbar>
  );
};

export default AppNavbar;
